import React from "react";
import { Label, Grupoinput, Input, LeyendaError, IconoValidacion} from "./../Elementos/Formulario";
import { faCircleCheck } from '@fortawesome/free-solid-svg-icons'

const InputUsuario = ({label, placeholder, LeyendaError}) => {
    return (
        <div>
            <Label htmlFor="usuario">{label}</Label>
        <Grupoinput>
        <Input type="text" placeholder={placeholder} id="usuario"/>
        <IconoValidacion icon={faCircleCheck}/>
        </Grupoinput>
              <LeyendaError>{LeyendaError}</LeyendaError>
          </div>
    );
 }
 export default InputUsuario;
